import React from "react";

import { FirstName ,LastName } from "./App" ; 



const ComC = ()=>{
	return(
	<>
	<FirstName.Consumer>
	{(fnam)=>{
	return (
	<LastName.Consumer>
      {(lnam)=>{
           return(<h1>my name is rahul {fnam} {lnam} </h1>);
      }}
	</LastName.Consumer>

	);
	}}
	</FirstName.Consumer>
	</>
	);
};

export default ComC;
